import React, { useState } from "react";
import "../AgeCalc.css";

export default function AgeCalculator() {
  const [year, setYear] = useState("");
  const [month, setMonth] = useState("");
  const [day, setDay] = useState("");
  const [age, setAge] = useState("");

  const calculateAge = () => {
    const currentDate = new Date();
    const birthDate = new Date(year, month - 1, day); // Note: month is zero-based

    if (birthDate > currentDate) {
      setAge("Invalid birth date");
      return;
    }

    let ageYears = currentDate.getFullYear() - birthDate.getFullYear();
    let ageMonths = currentDate.getMonth() - birthDate.getMonth();
    let ageDays = currentDate.getDate() - birthDate.getDate();

    if (ageMonths < 0 || (ageMonths === 0 && ageDays < 0)) {
      ageYears--;
      ageMonths += 12;
    }

    if (ageDays < 0) {
      const prevMonthDate = new Date(
        currentDate.getFullYear(),
        currentDate.getMonth() - 1,
        0
      );
      ageDays += prevMonthDate.getDate();
      ageMonths--;
    }

    setAge(
      `Your age is ${ageYears} years, ${ageMonths} months, and ${ageDays} days`
    );
  };
  const [dateOfBirth, setDateOfBirth] = useState("");
  const [todaysDate, setTodaysDate] = useState("");

  const [errorDateOfBirth, setDateOfBirthError] = useState("");
  const [errorTodaysDate, setTodaysDateError] = useState("");

  function dateDiff(date1, date2) {
    let d1 = new Date(date1);
    let d2 = new Date(date2);

    if (d2 > d1) {
      let temp = d1;
      d1 = d2;
      d2 = temp;
    }

    let years = d2.getFullYear() - d1.getFullYear();
    let months = d2.getMonth() - d1.getMonth();
    let days = d2.getDate() - d1.getDate();

    if (days < 0) {
      months--;
      days += new Date(d2.getFullYear(), d2.getMonth(), 0).getDate();
    }
    if (months < 0) {
      years--;
      months += 12;
    }
    return {
      years: years,
      months: months,
      days: days,
    };
  }

  let today = new Date();
  let birthday = "07/06/1997";
  console.log(dateDiff(birthday, today));

  function calculate() {
    if (dateOfBirth === "" || todaysDate === "") {
      dateOfBirth === ""
        ? setDateOfBirthError("Enter Valid Date : DD-MM-YYYY")
        : setDateOfBirthError("");
      todaysDate === ""
        ? setTodaysDateError("Enter Valid Date : DD-MM-YYYY")
        : setTodaysDateError("");
    } else {
      setDateOfBirthError("");
      setTodaysDateError("");
    }
  }
  function clear() {
    setDateOfBirth("");
    setTodaysDate("");
  }

  return (
    <>
      <div className="container p-2">
        <div className="text-center">
          <h1 className="text-info">Age Calculator</h1>
        </div>
        <hr />
        <div className="row">
          <span className="col-5">
            <h5 className="text-primary">Today's Date</h5>
          </span>
          <span id="inputError" className="col-7 text-danger text-end">
            {errorTodaysDate}
          </span>
        </div>
        <div>
          <input
            className="form-control"
            placeholder="DD/MM/YYYY"
            value={todaysDate}
            onChange={(e) => setTodaysDate(e.target.value)}
          ></input>
        </div>
        <div className="row mt-2 pt-2">
          <span className="col-5 text-primary">
            <h5>Date of Birth</h5>
          </span>
          <span id="inputError" className="col-7 text-danger text-end">
            {errorDateOfBirth}
          </span>
        </div>
        <div>
          <input
            className="form-control"
            placeholder="DD/MM/YYYY"
            value={dateOfBirth}
            onChange={(e) => setDateOfBirth(e.target.value)}
          ></input>
        </div>
        <div className="text-center mt-3 pt-3">
          <button
            className="btn btn-primary w-50 p-2"
            onClick={() => calculate()}
          >
            Calculate
          </button>
          <span className="mx-1"></span>
          <button className="btn btn-primary w-25 p-2" onClick={() => clear()}>
            Clear
          </button>
        </div>
        <div className="mt-2 pt-2">
          <hr />
          <h5 className="text-success">Age</h5>
          <div className="mx-5 border border-primary">
            <table className="table table-light">
              <th className="text-center">Year</th>
              <th className="text-center">Months</th>
              <th className="text-center">Days</th>
              <tbody>
                <td className="text-center text-primary">20</td>
                <td className="text-center text-primary">11</td>
                <td className="text-center text-primary">20</td>
              </tbody>
            </table>
          </div>
          <div className="mt-2 pt-2">
            <hr />
            <h5 className="text-success">Next Birthday</h5>
            <div className="mx-5 mt-2 border border-primary">
              <table className="table table-light">
                <th className="text-center">Months</th>
                <th className="text-center">Days</th>
                <tbody>
                  <td className="text-center text-primary">20</td>
                  <td className="text-center text-primary">11</td>
                </tbody>
              </table>
            </div>
          </div>
          <div className="mt-2 pt-2">
            <hr />
            <h5 className="text-success">Extra</h5>
            <div className="mx-5 mt-2 border border-primary">
              <table className="table table-light">
                <tbody>
                  <tr>
                    <td className="text-center">Total Years</td>
                    <td className="text-start text-primary">11</td>
                  </tr>
                  <tr>
                    <td className="text-center">Total Months</td>
                    <td className="text-start text-primary">11</td>
                  </tr>
                  <tr>
                    <td className="text-center">Total Week</td>
                    <td className="text-start text-primary">11</td>
                  </tr>
                  <tr>
                    <td className="text-center">Total Hours</td>
                    <td className="text-start text-primary">11</td>
                  </tr>
                  <tr>
                    <td className="text-center">Total Minutes</td>
                    <td className="text-start text-primary">11</td>
                  </tr>
                  <tr>
                    <td className="text-center">Total Seconds</td>
                    <td className="text-start text-primary">11</td>
                  </tr>
                </tbody>
